import React from 'react';

export default function hello_world() {
    var arr = [
        "hello!",
        "my name is Willow!",
        "this is my resume.",
        "you're looking at a random code snippet out of 20!",
        "these are written in various different languages!"
    ]
    return (
        <div>
            {
